contracts/MyContract.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.8.17;

contract Property {
    uint public price;
    address immutable public owner;

    int constant constArea = 100;   // Must be initialized.
    int immutable immutableArea;    // Can be initialized like a variable.

    constructor() {
        owner = msg.sender;
        immutableArea = 0;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    // function changeOwner(address _owner) public onlyOwner {
    //     owner = _owner;
    // }

    function setPrice(uint _price) public {
        price = _price;
    }

    function getPrice() public view returns(uint) {
        return price;
    }

    function getOwner() public view returns(address) {
        return owner;
    }
}

contract PriceSold {
    uint public price;
    bool public sold;

    string public location = "Paris";
   
    function setPrice(uint _price) public {
        price = _price;
    }

    // IMPORTANT is integer over and under flow (use of SafeMath will help)
    // Test for overflow 
    uint8 public x = 255;
    int8 public y = -13;

    function testOverFlow() public {
        x++;
    }

    function testUnderFlow() public {
        y--;
    }
}

